The Court Orders the Following:
Imposed and Stayed Sentence of: Count #4.  
1 year Jail without Huber.  (Credit - 5 days).  Concurrent. 
Term of Probation: 2 Years
Conditions of Probation:
AODA Assessment and follow through with any treatment recommended;
Absolute Sobriety; Random U.A.s;
No Use or Possession of illegal controlled substances;
Sign Any Release for Agent;
Follow through with any treatment and/or counseling recommended by Agent;
Maintain/Obtain full time employment;
Condition Time: 20 days Huber with  NON WORKING HOURS WITH STANDARD RELEASE CONDITIONS - To commence 11/30/2015 @ 8:00 pm. 
FINE: $1380.50 Bail to be applied, remainder of fine to be paid as a condition of probation
DNA previously done, waived.  
Felony warnings, immigration warnings, voting rights and firearms warnings given.
